import React, { useState } from 'react';
import { Line, Bar } from 'react-chartjs-2'; // Chart.js 그래프
import 'chart.js/auto'; // Chart.js 자동 등록
import './Dashboard.css'; // CSS 파일 임포트

function Dashboard() {
    const [activeTab, setActiveTab] = useState('dashboard'); // 현재 선택된 탭 상태

    // 임의 데이터 (그래프 데이터)
    const lineChartData = {
        labels: ['1월', '2월', '3월', '4월', '5월', '6월'],
        datasets: [
            {
                label: '전력 사용량 (kWh)',
                data: [1200, 1900, 3000, 5000, 2500, 3100],
                backgroundColor: 'rgba(75,192,192,0.4)',
                borderColor: 'rgba(75,192,192,1)',
                borderWidth: 2,
                fill: true,
            },
        ],
    };

    const barChartData = {
        labels: ['A공정', 'B공정', 'C공정', 'D공정', 'E공정'],
        datasets: [
            {
                label: '공정별 에너지 소비 (kWh)',
                data: [4000, 3000, 2000, 5000, 3500],
                backgroundColor: [
                    '#FF6384',
                    '#36A2EB',
                    '#FFCE56',
                    '#4BC0C0',
                    '#9966FF',
                ],
            },
        ],
    };

    return (
        <div className="dashboard-layout">
            {/* 좌측 네비게이션 바 */}
            <div className="sidebar">
                <h3>대시보드</h3>
                <ul>
                    <li>종합 대시보드</li>
                    <li>개별 대시보드</li>
                </ul>
                <h3>검침 정보</h3>
                <ul>
                    <li>최대수요전력 관리</li>
                    <li>검침 데이터 조회</li>
                    <li>에너지 사용 요약</li>
                </ul>
            </div>

            {/* 우측 콘텐츠 영역 */}
            <div className="main-container">
                {/* 상단 탭 바 */}
                <div className="tab-bar">
                    <button
                        className={`tab ${activeTab === 'dashboard' ? 'active' : ''}`}
                        onClick={() => setActiveTab('dashboard')}
                    >
                        종합대시보드
                    </button>
                    <button
                        className={`tab ${activeTab === 'comparison' ? 'active' : ''}`}
                        onClick={() => setActiveTab('comparison')}
                    >
                        공정별 비교
                    </button>
                </div>

                {/* 대시보드 콘텐츠 */}
                <div className="dashboard-content">
                    <div className="card-grid">
                        <div className="card">
                            <h2>최대 수요전력</h2>
                            <p className="highlight">89.46% (주의)</p>
                        </div>
                        <div className="card">
                            <h2>누적 사용량(전력)</h2>
                            <p className="highlight">115,908 MWh</p>
                            <p>9,030 MWh (단월)</p>
                        </div>
                    </div>

                    {/* 그래프 */}
                    <div className="chart-grid">
                        <div className="chart-card">
                            <h2>전력 사용량 추이</h2>
                            <Line data={lineChartData} />
                        </div>
                        <div className="chart-card">
                            <h2>공정별 에너지 소비</h2>
                            <Bar data={barChartData} />
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Dashboard;
